select distinct  a.* from service_order a, member b,eap_employee c
where a.ee_id=#{eeId} 
and a.is_delete=0

	and ((a.service_provider_id=b.mid and b.nickname like concat('%',#{words},'%'))
		or (a.mid = b.mid
			AND c.phone_num = b.mobile_phone
		 and c.ee_id=#{eeId} and
		c.name like concat('%',#{words},'%'))
		)


	AND a.create_time >= #{begin}


AND a.create_time <= #{end}


	 limit #{pageStartNum},#{pageSize}

select count(d.soid) from (select distinct a.soid from service_order a, member b,eap_employee c
where a.ee_id=#{eeId} 
and a.is_delete=0

	and ((a.service_provider_id=b.mid and b.nickname like concat('%',#{words},'%'))
		or (a.mid = b.mid
			AND c.phone_num = b.mobile_phone
		 and c.ee_id=#{eeId} and
		c.name like concat('%',#{words},'%'))
		)


	AND a.create_time >= #{begin}


AND a.create_time <= #{end}

) d

SELECT so.* FROM ( SELECT DISTINCT (member.mid) mid, member.mobile_phone FROM member, eap_employee WHERE eap_employee.ee_id = #{eeId} AND member.mobile_phone = eap_employee.phone_num AND eap_employee.is_delete = 0 AND member.is_delete = 0 ) t1 LEFT JOIN service_order so ON t1.mid = so.mid where so.is_delete=0 and so.ee_id=#{eeId}
and so.mid=#{mid}
limit #{pageStartNum},#{pageSize}


